%[text] ## Resampling CGM Glucose Values
%[text] This notebook demonstrates how cgm data is resampled, as well as how gaps in the cgm data are handled.
%[text] ### Create some CGM data
%[text] The CGM data is equally spaced but not aligned to the hour.
datetimes = datetime("today") + minutes(2:5:62)';
cgm = pchip([0 30 60],[100 120 100],0:5:60)';
cgmTT = timetable(cgm,'RowTimes',datetimes) %[output:2b46b9dd]
cgmResampled = AIDIF.interpolateCGM(cgmTT) %[output:50e9dc24]
plotCGM(cgmTT,cgmResampled) %[output:592303c3]
%[text] The resampled CGM data is aligned to the hour, and values are interpolated from the original data.
%%
%[text] ### Introduce Gaps \< 30 minutes
%[text] Gaps less than 30 minutes are interpolated.
removed = cgmTT([4 6:8 11:12],:);
cgmTT([4 6:8 11:12],:) = [] %[output:4a65f9f8]
cgmResampled = AIDIF.interpolateCGM(cgmTT);
plotCGM(cgmTT,cgmResampled,removed) %[output:5bec099f]
%[text] The CGM data is resampled through the gaps that are less than 30 minutes, as the results remain approximate to the true glucose trend.
%%
%[text] ### Introduce Gap =\>30 minutes
%[text] Gaps 30 minutes or longer are filled with NaN.
removed = [removed;cgmTT(4:5,:)];
cgmTT(4:5,:) = [];
cgmResampled = AIDIF.interpolateCGM(cgmTT);
plotCGM(cgmTT,cgmResampled,removed) %[output:66d815e1]
%[text] The CGM data is not resampled for gaps which are 30 minutes or greater. There is not enough information to approximate true cgm results.

function plotCGM(cgmTT,cgmResampled,removed)
    arguments
        cgmTT
        cgmResampled
        removed = timetable()
    end
    clf;hold off
    stem(cgmTT.Time,cgmTT.cgm,'-x')
    hold on
    plot(cgmResampled.Time,cgmResampled.cgm,'g-o')
    ylim([90 130])
    xlabel('time')
    ylabel('glcuose (mg/dL)')
    title('InterpolateCGM Results')
    if isempty(removed)
        legend(["raw CGM" "resampled CGM"])
    else
        scatter(removed.Time,removed.cgm,'rx')
        legend(["raw CGM" "resampled CGM"  "missing raw CGM"])
    end
    
end

